import React from 'react';
import {Link} from 'react-router-dom';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';

const Home = (props) => {
  return (

<Router>
 <div>
   <nav>
     <ul>
       <li>
         <Link to="/">Home</Link>
       </li>
       </ul>
       </nav>
       </div>

       <Switch>
       <Route path="/">
         <Hometown />
       </Route>
     </Switch>

       </Router>
     )}

       function Hometown() {
         return <h2>Home</h2>;
       }

export default Home;
